INSERT INTO BOARD_YOUTUBE (YTB_IDX, YTB_TITLE, YTB_URL, YTB_INFO, YTB_REGDATE, YTB_HIT, YTB_LIKE, YTB_CHANNEL_NAME, YTB_CHANNEL_URL, YTB_THUMBNAIL, MEM_ID, YTB_CHANNEL_THUMB, YTB_EMBED_URL) VALUES (10012, '[님아 그 시장을 가오_EP. 03_청도] 만나면 일단 복숭아부터 주는 청도. 밥 먹을 곳 찾다가 복숭아로 배 채우는 게 청도 인심 아닙니꺼!', 'https://www.youtube.com/watch?v=oTJXvv6x7mQ', '#백종원 #시장 #청도\n\n오늘은 경상북도 청도에 왔어유~\n청도시장 간 것만 봐도 알겠지만, 청도 인심 참 좋죠?\n덕분에 청도 복숭아 원 없이 먹었어유!\n복숭아 많이 먹었어도 역시 한국인은 밥을 먹어야지요~\n　\n여긴 조금 특이한 집이에유~\n이름은 국밥집인데 국밥은 안 팔고 육회비빔밥 전문이래요!\n듣자 하니 육회비빔밥이 너무 잘 나가서 국밥을 없앴다고 하는데~\n얼마나 맛있어서 그러는지 상당히 기대가 되쥬?\n　\n오늘도 정겨운 청도에서 잘 먹고 잘 놀았네유!\n다음엔 또 어느 시장을 가볼까나~', TO_DATE('2022-08-31 10:07:27', 'YYYY-MM-DD HH24:MI:SS'), 0, 0, '백종원의 요리비책 Paik''s Cuisine', 'http://www.youtube.com/channel/UCyn-K7rZLXjGl7VXGweIlcA', 'https://i.ytimg.com/vi/oTJXvv6x7mQ/maxresdefault.jpg', 'admin', 'https://yt3.ggpht.com/ytc/AMLnZu98MEQvuszPd3pPRdkn47wibmrW81BeDYy3lj15pQ=s176-c-k-c0x00ffffff-no-rj', 'https://www.youtube.com/embed/oTJXvv6x7mQ');
