INSERT INTO BOARD_YOUTUBE (YTB_IDX, YTB_TITLE, YTB_URL, YTB_INFO, YTB_REGDATE, YTB_HIT, YTB_LIKE, YTB_CHANNEL_NAME, YTB_CHANNEL_URL, YTB_THUMBNAIL, MEM_ID, YTB_CHANNEL_THUMB, YTB_EMBED_URL) VALUES (10014, '뉴욕 타임스퀘어 비보이 공연에 레전드 한국 비보이들의 ''깜짝 등장'' 사건의 결말 ☺️/ [아메리카 24]', 'https://www.youtube.com/watch?v=MRz3SjiC9sM', '민성이는 뉴욕에 오래전에 와서 굉장한 것들을 이루고 있었습니다.\n한국에서 비보이 생활을 할 때도 한국 최초로 나인틴 바퀴수를 기록했고 굉장히 요염하고 아름다운? 자태로 파워무브를 선보여 굉장히 주목받던 친구였는데 어느날 갑자기 뉴욕에 간다는 소식을 들었는데\n지금은 유명한 회사의 꽤 높은 자리에 앉아 있는 회사원이 되었더라고요.\n그모습도 참 멋있었습니다.\n인터뷰도 많이 하고 민성이 뉴욕에서 어떤 생활을 했는지 영상에 많이 담았는데 이것 역시 모두 날아가서 너무 아쉽습니다. 큰 영감을 받았었거든요.\n그래도 뉴욕 타임스퀘어에서 함께 춤추며 옛추억을 더듬었던 소중한 시간은 기록이 남아있어서 다행이예요.\n#한국비보이 #레전드비보이 #비보이공연\n-------------------------------------------------\n인스타그램 : gamblerzbrucelee\n협찬 및 광고, 콜라보레이션 문의 : gambboy@naver.com\n--------------------------------------------------\n476일간 비보이의 세계일주 정주행 : https://www.youtube.com/playlist?list=PLgdHaSUKeyXNVFqPO9VHyRr4qWAQYdaSU\n\n여행 중 벌린 춤 판 정주행 : https://www.youtube.com/watch?v=UxIdQckIZZc\u0026list=PLgdHaSUKeyXPeOvK2QeGLsm2opKDhqKed\n\n제주 에세이 : https://www.youtube.com/watch?v=zc9avQMlERo\u0026list=PLgdHaSUKeyXPGRpvvVFyRtV8Q8AfgpxcN', TO_DATE('2022-08-31 10:07:28', 'YYYY-MM-DD HH24:MI:SS'), 0, 0, '비보이의 세계일주 [브루스리 TV]', 'http://www.youtube.com/user/GAMBLERZBRUCELEE', 'https://i.ytimg.com/vi/MRz3SjiC9sM/maxresdefault.jpg', 'admin', 'https://yt3.ggpht.com/Ppv4-tSTPOjmfnY_Su69NCrAtMH7g0vbB4I_j5pSZpKpVPj-o9Bh3ltzEUd5mOertF8gpbtVTw=s176-c-k-c0x00ffffff-no-rj', 'https://www.youtube.com/embed/MRz3SjiC9sM');
