k in the comments below!.\n▽ Follow Earth Relaxation\n➤ Youtube → https://www.youtube.com/channel/UCS4jPUCax8d3f-uke--YXXQ\n#earthrelaxation​ #relaxingmusic​ #4kswitzerland\n----------------------------------------------------------------------\nMusic provided by EMVN\nSubmit your music: http://emvn.co/submitDemo\n📌 Contacts: copyright.thstudio@gmail.com, network@emvn.co\nTrack list:\n0:0:0   | 1 . Calm\n0:4:52  | 2 . Water\n0:9:25  | 3 . Relax\n0:14:19 | 4 . Beach\n\nFollow Artists:\nhttps://emvn.fanlink.to/melosy\n----------------------------------------------------------------------\n►All rights belong to their respective owners.\n✔ This video was given a special license directly from the artists and the right holders.', TO_DATE('2022-08-31 10:08:11', 'YYYY-MM-DD HH24:MI:SS'), 0, 0, 'Earth Relaxation', 'http://www.youtube.com/channel/UCS4jPUCax8d3f-uke--YXXQ', 'https://i.ytimg.com/vi/NoEIriuS0H8/maxresdefault.jpg', 'admin', 'https://yt3.ggpht.com/QyphZ7T7QO0Sl1HwT29whWwFP-Mf8Eu38sPN8tN-w--cotSJ7AogV92wygj06X3UD7rcWHUyKwQ=s176-c-k-c0x00ffffff-no-rj', 'https://www.youtube.com/embed/NoEIriuS0H8');
