INSERT INTO BOARD_YOUTUBE (YTB_IDX, YTB_TITLE, YTB_URL, YTB_INFO, YTB_REGDATE, YTB_HIT, YTB_LIKE, YTB_CHANNEL_NAME, YTB_CHANNEL_URL, YTB_THUMBNAIL, MEM_ID, YTB_CHANNEL_THUMB, YTB_EMBED_URL) VALUES (10062, '하루가 지나도 절대 불지 않는 잡채 만들기', 'https://www.youtube.com/watch?v=vqb3WyZmL_8', '김대석 셰프의 31년 노하우를 공개합니다.\n오늘은 잡채 레시피를 알려 드리겠습니다.\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\n컵 계량은 200mL 기준입니다\n(종이컵으로는 가득 채운 1컵입니다)\n스푼 계량은 집에 흔히 있는 밥 숟가락 기준입니다\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\n\n[메인 재료]\n당면 250g(1시간 불리기)\n식용유 4스푼\n물 1컵 반(300ml)\n\n[야채 준비]\n양파 1/2개, 당근 1/2개, 생표고버섯 3개, 부추 반줌(겨울에는 시금치 사용)\n\n[양념 재료]\n진간장 1/3컵(7스푼), 굴소스 2스푼, 미림 1/4컵, 흑설탕 가득 2스푼,\n다진마늘 가득 1스푼, 후추 1/4스푼, 참기름 1스푼, 통깨 2스푼\n\n(마지막 넓은 그릇에 옮겨 식혀주기)\n#김대석셰프 #잡채', TO_DATE('2022-08-31 10:08:49', 'YYYY-MM-DD HH24:MI:SS'), 0, 0, '김대석 셰프TV', 'http://www.youtube.com/channel/UC1g9JaEVLOFGhH8hpaK--Jg', 'https://i.ytimg.com/vi/vqb3WyZmL_8/maxresdefault.jpg', 'admin', 'https://yt3.ggpht.com/aupNCO-3Qu8vAKwSMhLIlrhXi25j4cnqOE-00u6vODlFLDTAied56l_pTLCpYCknkGvRxhNg=s176-c-k-c0x00ffffff-no-rj', null);
